import React from "react";
import "../css/home.css";
import { Link } from "react-router-dom";
const FavoriteMenu = () => {
  return (
    <div>
      <div className="favorite-page">
        <div className="container">
          <p className="p-red">En Çok Paketlenen Menüler</p>
          <p className="p-white">Acıktıran Kodlara Doyuran Lezzetler</p>
          <Link to="/siparis-ver" exact>
            <button className="btn btn-warning rounded-pill px-5">
              ACIKTIM
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
};
export default FavoriteMenu;
